import React from "react";
import './Header.css';

function Header() {
    return (
        <div>
            <header>
                <ul className="headerList">
                    <h1 className="headerElement">Главная</h1>
                    <h1>Календарь</h1>
                    <h1>Профиль</h1>
                    <h1>Вход</h1>
                    <h1>Настройки</h1>
                </ul>
            </header>
        </div>
    )
}

export default Header;
